import React from "react";
import { Table } from "react-bootstrap";

export const TableComponent: React.FC<{ children: any }> = ({ children }) => {
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>{children}</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>{children}</td>
        </tr>
      </tbody>
    </Table>
  );
};
